import './App.css';

function Home() {
  return (
    <div class="main">Hello from Home</div>
  );
};

function Indexes() {
  return (
    <div>Indexes</div>
  );
};

function Charts() {
  return (
    <div>Charts</div>
  );
};

function Info() {
  return (
    <div>Info</div>
  );
};

export default Home
